import logo from './logo.svg';
import './App.css';
import TextField from '@mui/material/TextField';

function App() {
  return (
    <div>
        <TextField label="Email Address"
         required
         fullWidth
         name="email"
         autoComplete="email"
         autoFocus
         />
        <TextField label="Password"
         type="password" required fullWidth  name="password" />
    </div>
  );
}

export default App;
